import styled from "styled-components";

const Father = styled.div`
display : flex;
`;

const Input = styled.input`
background-color :tomato;
`;


function App() {
  return (
  
  <Father ad="header">
   <Btn>Log in</Btn>
   <Btn as="a" href="/">Log in</Btn>
  </Father>
   );

}

export default App;
